// PhoneSearchPage.js

import React, { useState } from 'react';
import { phoneNumbers } from './simulatedData';

function PhoneSearchPage() {
    const [searchTerm, setSearchTerm] = useState('');
    const [results, setResults] = useState([]);

    const handleSearch = (term) => {
        const filteredResults = phoneNumbers.filter(item =>
            item.phoneNumber.includes(term)
        );
        setResults(filteredResults);
    };

    const handleInputChange = (e) => {
        const value = e.target.value;
        setSearchTerm(value);
        handleSearch(value);
    };

    return (
        <div className="phone-search-page">
            <h2>Search Phone Numbers</h2>

            <div className="search-section">
                <input
                    type="tel"
                    value={searchTerm}
                    onChange={handleInputChange}
                    placeholder="Enter phone number..."
                />
            </div>

            <div className="results-section">
                <ul>
                    {results.map(item => (
                        <li key={item.id}>
                            ID: {item.id}, Phone: {item.phoneNumber}
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
}

export default PhoneSearchPage;
